import './css/App.css';

import Home from './pages/home.js';
import Result from './component/test.js';
import React, { Component } from 'react';

import { BrowserRouter, Route, Link } from 'react-router-dom';

const test1 = () => {
  <div>Test 1</div>
}


const test2 = () => {
  <div>Test 2</div>
}



const App = () => {
      <BrowserRouter>
      <div>

          <div><Link to="/">Test 3</Link></div>   
          <div><Link to="/yolo">Test 4</Link></div>   

          <Route path="/" component={test1} />
          <Route path="/yolo" component={test2} />
      </div>
      </BrowserRouter>
}

export default App;

